import React from "react";
import {NavLink as NavLinkRRD} from "react-router-dom";

const NavLink = ({to,children,...props})=>{
    return (
        <NavLinkRRD
        {...props}
        className={({isActive})=> (isActive?styles.isActive:undefined)}
        to={to}
        >
            {children}
        </NavLinkRRD>
    );
}
const  Favorites = () => {
  return (
    <div>
      <h2>Favorites</h2>
      <h4>todo melo</h4>
      <NavLink></NavLink>
    </div>
  );
};
export default Favorites;
